    // function minter() returns (address) { return minter; } // 자동으로 만들어지는 함수


    // 주소와 양의 정수를 연결(매핑)
    mapping(address => uint) public balances;
    // function balances(address _account) external view returns (uint) {
    //     return balances[_account]; // 자동으로 만들어지는 함수

    event Sent(address from, address to, uint mount);

    constructor() {
        minter = msg.sender; // msg.sender 는 외부에서 지금 함수를 호출한 주소
        // msg (tx 와 block 포함)는 유용한 전역 변수로 블록체인에 접근할 수 있는 다양한 속성들을 담고 있음
    }

    function mint(address receiver, uint amount) public {
        require(msg.sender == minter); // 만약 mint 를 호출한 사용자가 컨트랙트를 만든 사람이 아니면 아무일도 일어나지 않습니다
        // 이는 인수가 false로 평가될 경우 모든 변경 사항이 원래대로 되돌아가도록 하는 특수 함수 require 에 의해 보장됩니다
        // require 를 두 번째로 호출하면 코인이 너무 많아지게 되고, 이는 차후에 오버플로우 에러의 원인이 될 수 있습니다. (??)
        require(amount < 1e60);
        balances[receiver] += amount;
    }

    function send(address receiver, uint amount) public {
        require(amount <= balances[msg.sender], "Insufficient balance.");
        balances[msg.sender] -= amount;
        balances[receiver] += amount;
        emit Sent(msg.sender, receiver, amount);
    }
}
